import axios from 'axios';


 
function Login(){
  return (
    <form >
      <div>
        <label>Email:</label>
        <input type="email"  required />
      </div>
      <div>
        <label>Password:</label>
        <input type="password" required />
      </div>
      <button type="submit">Login</button>
    </form>
  );
};

export default Login;
